import ReactDOM from 'react-dom';
import './index.css';
// import Card from './Cards';
import Sdata from './Sdata';
// import App from './App';


// console.log(Sdata[0].sname);

const Cards = (props) =>{
   return ( <> <div className="cards">

    <div className="card">

    <img src={props.imgsrc} />
     <div className="card__title">
         <h1>{props.title}</h1>
     </div>

        <div className="card__info">
             <h3>{props.sname}</h3>
             <button className="button">Show More</button>
        </div>

    </div>

</div>

</>
   )
}



ReactDOM.render(<>  <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES IN 2021</h1>
<div className="flexBox">
{Sdata.map((value) =>{
    return (
        <Cards key={value.id}
        imgsrc={value.imgsrc}
        title={value.title}
        sname={value.sname}
        Sname={value.link}
      />
    )

})}


</div>
</>


